import React, { Component } from "react";
import Image from "../Home Page/image1.jpeg";

class HomePage extends Component {
  render() {
    return (
      <div className="container-home">
        <div className="row1">
          <div className="column">
            <img src={Image} />
          </div>
        </div>
      </div>
    );
  }
}

export default HomePage;
